Love and Loss (NEW 2014 Wicked Pictures) (Split Scenes)

Maddy O'Reilly, AJ Applegate, Penny Pax

With more twists and turns than the German autobahn, Love and Loss follows the story of Lanie and Alex, an ex-cop involved in the shooting of Lanie's ex-lover. Replete with suspense, betrayal and unbridled passion, this couples-friendly, plot-driven feature is guaranteed to arouse both the mind and body!

